f niet ontbreken en je gebruikt een logo als het echt niet anders kan. Je moet ook vooral geen apenkoppen gebruiken, want mensen praten natuurlijk niet met een aap. Maar ook in dit geval heb ik weer eens een gigantische plaat voor mijn hoofd en denk gewoon dat ik het beter weet. Ook moet je zeker 5 keer per dag een story post plaatsen en het liefste over hetgeen wat je aan het doen ben en daar mag dan 1 post bijzitten over je bedrijf.  Dus eigenlijk moet je je persoonlijke account ook nog eens gaan upgraden tot een business account zodat je allemaal handige analyse tools erop kunt loslaten of je kan zoals ik door de bomen het bos niet meer zien. Oh het alleraller belangrijkste is natuurlijk dat je een blog hebt. Daar kan je je dan helemaal op uitleven en giga lappen tekst schrijven. Helaas heb ik dus niet echt veel verstand van het internet dus aan een blog begin ik al helemaal niet. En als laatste wil ik nog zeggen dat een post hoort te eindigen met een Call To Action. Wil je echt als een pro overkomen dan noem je dit nonchalant een CTA, lijkt het net of je al jaren bezig bent";}i:121;a:1:{s:14:"comments_count";i:6;}i:122;a:1:{s:11:"likes_count";i:6;}i:123;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvERuHj4Cc";}i:124;a:1:{s:5:"image";s:249:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118989647_911075859417601_9187534577203929569_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=101&_nc_ohc=FFEcPl555ZgAX-Shx06&oh=f5e9c2f239f810db8a73114fa3b43094&oe=5F7A75F3";}i:125;a:1:{s:4:"type";s:5:"image";}i:126;a:1:{s:8:"owner_id";i:12143016313;}i:127;a:1:{s:14:"owner_username";s:0:"";}i:128;a:1:{s:14:"owner_fullname";s:0:"";}i:129;a:1:{s:9:"owner_pic";s:0:"";}i:130;a:1:{s:2:"id";s:19:"2391147490832231985";}i:131;a:1:{s:10:"short_code";s:11:"CEvD_lcny4x";}i:132;a:1:{s:12:"created_time";i:1599267015;}i:133;a:1:{s:7:"caption";s:111:"#smokedchickenwings a special this week at pinkys bbq #pinkysbbq #nomnom #stickburner #foodporn #yummyinmytummy